SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);
const Banner = () => {
    return (

        <Swiper
      spaceBetween={50}
      slidesPerView={3}
      navigation
      pagination={{ clickable: true }}
      scrollbar={{ draggable: true }}
      onSwiper={(swiper) => console.log(swiper)}
      onSlideChange={() => console.log('slide change')}
    >
     <SwiperSlide>
                <img src="https://media.gettyimages.com/vectors/online-shopping-banner-template-with-line-icons-modern-vector-for-vector-id1159749314" alt=""/>
